CREATE TABLE IF NOT EXISTS "league" (
	"id"	integer NOT NULL,
	"name"	varchar(50) DEFAULT NULL,
	"country"	integer NOT NULL,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("country") REFERENCES "country"("id")
);
CREATE TABLE IF NOT EXISTS "players" (
	"id"	INTEGER,
	"name"	varchar(20) NOT NULL,
	"surname"	varchar(30) NOT NULL,
	"dateofbirth"	date NOT NULL,
	"nationality"	INTEGER DEFAULT NULL,
	"position"	position text DEFAULT NULL CHECK("position" IN ('Striker', 'Midfielder', 'Defender', 'Goalkeeper')),
	"club"	tinyint unsigned NOT NULL,
	"value"	INTEGER unsigned NOT NULL,
	"salary"	INTEGER unsigned NOT NULL,
	"contract_terminates"	date NOT NULL,
	"offense"	INTEGER DEFAULT NULL,
	"defence"	INTEGER DEFAULT NULL,
	"overall"	INTEGER DEFAULT NULL,
	"potential"	INTEGER DEFAULT NULL,
	"pass"	integer DEFAULT null,
	"gk"	INTEGER DEFAULT null,
	"isJunior"	boolean DEFAULT 0,
	"isRetiring"	boolean DEFAULT 0,
	"currPosition"	text DEFAULT null,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("club") REFERENCES "club"("id"),
	FOREIGN KEY("nationality") REFERENCES "country"("id")
);
CREATE TABLE IF NOT EXISTS "club" (
	"id"	integer,
	"name"	character(50) NOT NULL,
	"league"	integer unsigned DEFAULT NULL,
	"overall"	double DEFAULT NULL,
	"budget"	double DEFAULT NULL,
	"salaryBudget"	double DEFAULT NULL,
	"coach"	varchar(50) DEFAULT NULL,
	"points"	tinyint unsigned DEFAULT '0',
	"played"	INTEGER DEFAULT '0',
	"scored_goals"	integer DEFAULT '0',
	"lost_goals"	integer DEFAULT '0',
	"wins"	INTEGER DEFAULT '0',
	"loses"	INTEGER DEFAULT '0',
	"draws"	INTEGER DEFAULT '0',
	FOREIGN KEY("league") REFERENCES "league"("id"),
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "country" (
	"id"	integer NOT NULL,
	"name"	varchar(80) DEFAULT NULL,
	"iso"	character(2) DEFAULT NULL,
	"iso3"	character(3) NOT NULL,
	"numcode"	smallint DEFAULT NULL,
	PRIMARY KEY("id" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "schedule" (
	"id"	integer NOT NULL,
	"host"	tinyint NOT NULL,
	"visitor"	tinyint NOT NULL,
	"host_goals"	tinyint DEFAULT NULL,
	"visitor_goals"	tinyint DEFAULT NULL,
	"matchday"	tinyint DEFAULT NULL,
	"league"	integer unsigned DEFAULT NULL,
	"date"	DATE,
	FOREIGN KEY("league") REFERENCES "league"("id"),
	FOREIGN KEY("host") REFERENCES "club"("id"),
	FOREIGN KEY("visitor") REFERENCES "club"("id"),
	PRIMARY KEY("id" AUTOINCREMENT)
);
COMMIT;
